package com.willowtreeapps.common.repo

import kotlinx.coroutines.Dispatchers
import kotlinx.coroutines.GlobalScope
import kotlinx.coroutines.delay
import kotlinx.coroutines.withContext
import kotlinx.serialization.json.Json


class MockRepositoryFactory {

    fun success(): ProfilesRepository {
        return object : ProfilesRepository {
            override suspend fun profiles(): GatewayResponse<List<Profile>, GenericError> {
                return GatewayResponse.createSuccess(getValidResponse(), 200, "Successful mock Respoonse")
            }
        }
    }

    fun delayedLoading(delayInMs: Long): ProfilesRepository {
        return object : ProfilesRepository {
            override suspend fun profiles(): GatewayResponse<List<Profile>, GenericError> {
                return withContext(Dispatchers.Default) {
                    delay(delayInMs)
                    GatewayResponse.createSuccess<List<Profile>, GenericError>(getValidResponse(), 200, "Successful mock response")
                }
            }
        }
    }

    fun error(): ProfilesRepository {
        return object : ProfilesRepository {
            override suspend fun profiles(): GatewayResponse<List<Profile>, GenericError> {
                return GatewayResponse.createError(GenericError("Mock error from server"), 500, "Mock error from server")
            }
        }
    }


